import React, {Fragment, Component} from 'react';
import CSSTransitionGroup from 'react-transition-group/CSSTransitionGroup'

import AppHeader from '../../Layout/AppHeader/';
import AppSidebar from '../../Layout/AppSidebar/';
import AppFooter from '../../Layout/AppFooter/';

// Theme Options

import ThemeOptions from '../../Layout/ThemeOptions/';
import {Button, Card, Col, ListGroup, ListGroupItem, Row} from "reactstrap";
import bg1 from "../../assets/utils/images/dropdown-header/abstract1.jpg";
import avatar1 from "../../assets/utils/images/avatars/1.jpg";
import bg2 from "../../assets/utils/images/dropdown-header/abstract2.jpg";
import avatar2 from "../../assets/utils/images/avatars/2.jpg";
import LiquidFillGauge from "react-liquid-gauge";
import bg3 from "../../assets/utils/images/dropdown-header/abstract3.jpg";
import avatar3 from "../../assets/utils/images/avatars/3.jpg";
import cx from "classnames";

const Homepage = () => (
    <Fragment>
        <AppHeader/>
            <div className="app-main">
                <div className="app-main__inner">
                    <Row>
                        <Col sm="6" lg="4" xl="3">
                            <Card className="mb-3 profile-responsive">
                                <div className="dropdown-menu-header">
                                    <div className="dropdown-menu-header-inner bg-dark">
                                        <div className="menu-header-image opacity-1"
                                             style={{
                                                 backgroundImage: false
                                             }}
                                        />
                                        <div className="menu-header-btn-pane">
                                                <img src={bg1}/>


                                            {/*<div className="avatar-icon-wrapper mr-3 avatar-icon-xl btn-hover-shine">*/}
                                            {/*    <div className="avatar-icon rounded">*/}
                                            {/*        <img src={avatar1} alt="Avatar 5"/>*/}
                                            {/*    </div>*/}
                                            {/*</div>*/}
                                            {/*<div>*/}
                                            {/*    <h5 className="menu-header-title">Jeff Walberg</h5>*/}
                                            {/*    <h6 className="menu-header-subtitle">Lead UX Developer</h6>*/}
                                            {/*</div>*/}
                                            {/*<div className="menu-header-btn-pane">*/}
                                            {/*    <Button color="success">*/}
                                            {/*        View Profile*/}
                                            {/*    </Button>*/}
                                            {/*</div>*/}
                                        </div>
                                    </div>
                                </div>
                                <ListGroup flush>
                                    <ListGroupItem>
                                        <div className="widget-content pt-1 pl-0 pr-0">
                                            <div className="text-center">
                                                <h5 className="widget-heading opacity-4 mb-0">
                                                    Month Totals
                                                </h5>
                                                <h6 className="mt-3 mb-3">
                                                    <span className="pr-2">
                                                        <b className="text-danger">12</b> new leads,
                                                    </span>
                                                    <span>
                                                        <b className="text-success">$56.24</b> in sales
